      while (de.parentElement != null) {
        de = de.parentElement
        ol += de.offsetLeft
        ot += de.offsetTop
      }

      mouse.x = ((Pointers.page.x - ol) / canvas.clientWidth) * 2 - 1
      mouse.y = -((Pointers.page.y - ot) / canvas.clientHeight) * 2 + 1

      raycaster.setFromCamera(mouse, camera)
