      // mouse.y = (- Pointers.position.y / height) * 2 + 1
      raycaster.setFromCamera(mouse, camera)
      const intersection_objects = raycaster.intersectObject(states.sphere_mesh, true)
      if (intersection_objects.length > 0) {
        const intersection = intersection_objects[0]

        let min_distance_squared = 1000 * 1000
        let min_evento = null
        for (const evento of states.eventos) {
          const distance_squared = intersection.point.distanceToSquared(evento.mesh.position)
          if (distance_squared < min_distance_squared) {
            min_distance_squared = distance_squared
            min_evento = evento
          }
        }
        if (min_evento != null && min_distance_squared < (maximum_selection_distance * maximum_selection_distance)) { result = min_evento }
      }
      return result
