      const qp = new THREE.Vector2(args.q.x - args.p.x, args.q.y - args.p.y)
      const xp = new THREE.Vector2(args.x.x - args.p.x, args.x.y - args.p.y)
      const n = xp.dot(qp)
      const d = qp.dot(qp)
      const t = n / d
      if (t <= 0) return args.p.clone()
      if (t >= 1) return args.q.clone()
      const r = new THREE.Vector2()
      r.lerpVectors(args.p, args.q, t)
      return r
